            <div>
                <h2 style={{marginTop: '0'}}>Устройства</h2>
                <p style={{marginTop: '0'}}>Подключите соцсети, чтобы входить за пару кликов с любого устройства. Не публикуем ссылки на ваши соцсети.</p>
            </div>
            <div>
                
            </div>
        </div>
    </Fragment>);
}

